export function createHook<TInput extends z.ZodType, TOutput extends z.ZodType>({ name, inputSchema, outputSchema, execute, options = {}
}: { name: string; inputSchema: TInput; outputSchema: TOutput; execute: (input: z.infer<TInput>) => Promise<z.infer<TOutput>>; options?: { cacheKey?: (input: z.infer<TInput>) => string; debounceMs?: number; retryCount?: number; };
}) { return function useHook(input: z.infer<TInput>) { const [data, setData] = useState<z.infer<TOutput> | null>(null); const [loading, setLoading] = useState(false); const [error, setError] = useState<Error | null>(null); // Validate input const validatedInput = inputSchema.parse(input); // Execute with error handling const executeWithRetry = useCallback(async () => { setLoading(true); setError(null); let attempts = 0; const maxAttempts = options.retryCount ?? 1; while (attempts < maxAttempts) { try { const result = await execute(validatedInput); const validatedOutput = outputSchema.parse(result); setData(validatedOutput); setLoading(false); return; } catch (err) { attempts++; if (attempts >= maxAttempts) { setError(err instanceof Error ? err : new Error(String(err))); setLoading(false); } } } }, [validatedInput]); useEffect(() => { executeWithRetry(); }, [executeWithRetry]); return { data, loading, error, refetch: executeWithRetry }; };
}

